	 * Create a lifeline in the diagram
	 * 
	 * @param interaction
	 *        the interaction containing the lifeline
	 * @param name
	 *        the name of the lifeline
	 * @param diagram
	 *        the sequence diagram
	 * @return the lifeline edit part
	 */
	public static LifelineEditPart createLifeline(Interaction interaction String name Diagram diagram) {
		// create the lifeline
		Lifeline lifeline = interactioncreateLifeline(name);
		// create the edit part
		LifelineEditPart lifelineEditPart = (LifelineEditPart)UMLEditPartFactorygetInstance()createGraphicEditPart(diagram lifeline);
		// set the location
		Point location = SequenceUtilgetLifelineLocation(interaction lifeline);
		ChangeBoundsRequest request = new ChangeBoundsRequest(RequestConstantsREQ_MOVE);
		requestsetEditParts(lifelineEditPart);
		requestsetLocation(location);
		Command command = lifelineEditPartgetCommand(request);
		if(command != null && commandcanExecute()) {
			commandexecute();
		}
		return lifelineEditPart;
